import React from "react";
import { Menu, Segment } from "semantic-ui-react";

export const NavBar = () => {
  return (
    <Menu inverted secondary>
      <Menu.Item
        name='home'
      />
      <Menu.Item
        name='messages'
      />
      <Menu.Item
        name='friends'
      />
    </Menu>
  );
};
